import React from 'react';
import './Imagelinkform.css';

const Imagelinkform = ({onInputChange,onButtonSubmit}) => {

	return(

		<div >		
			<p className="f3 white">{'This Magic Brain Will Detect Faces In Your Pictures '}
			</p>
			<div className="center">
				<div className="form center pa4 br3 shadow-5">
					<input className="w-70 f4 pa2 center" type="text" placeholder="Insert image url here..." onChange ={onInputChange}/>
					<button className="f4 w-30 dib grow ph3 pv2 link white bg-light-purple" onClick={onButtonSubmit}>Detect</button>
				</div>
			</div>
		</div>
	);
}
export default Imagelinkform;
